window.bookSummaryJSON = "<p><b><i>Selected as one of Audible's best audiobooks of 2021</i></b>&nbsp;&nbsp;</p> <p><b>Jason wakes up in a mysterious world of magic and monsters. </b></p> <p>It’s not easy making the career jump from office-supplies-store middle manager to heroic interdimensional adventurer. At least, Jason<i> tries </i>to be heroic, but it's hard to be good when all your powers are evil.</p> <p>He’ll face off against cannibals, cultists, wizards, monsters...and that’s just on the first day. He’s going to need courage, he’s going to need wit, and he’s going to need some magic powers of his own. But first, he’s going to need pants.</p> <p><b>After cementing itself as one of the best-rated serial novels on Royal Road with an astonishing 13 million views,</b><b><i> He Who Fights with Monsters</i></b><b> is now brought to you in professionally formatted audio. </b></p>"; 
